contract TokenERC20 is Ownable, ERC20 {
    using SafeMath for uint256;

    uint256 public buyFeeRate = 1;
    uint256 public treasuryAndMarketingFee = 10;
    uint256 public stakingFee = 5;
    uint256 public constant feeDenominator = 100;

    uint256 public antiWhaleAmount;
    uint256 public antiWhaleStartTime;
    uint256 public constant antiWhaleDuration = 15 minutes;

    address public treasuryAddress = 0x1B51122c0740C55206BE4b3413CDB44156C79488;
    address public stakingAddress = 0x1529e3b77Da40531A05ca186ceEd1B2F6a3E1ba2;

    mapping(address => bool) public presaleAddress;

    constructor(
        string memory name,
        string memory symbol,
        uint8 decimals
    ) ERC20(name, symbol, decimals) Ownable(treasuryAddress) {}

    function setAntiWhaleAmount(uint256 _amount) public onlyTreasury {
        // set anti whale amount also activate antibot
        require(antiWhaleAmount == 0, "Can active antiWhale once"); // antiWhale can only activate once
        antiWhaleAmount = _amount;
        antiWhaleStartTime = block.timestamp - 10; // safty margin 10s
    }

    function isAntiWhaleEnded() public view returns (bool) {
        return block.timestamp > antiWhaleStartTime + antiWhaleDuration;
    }
    function setStakingAddress(address _stakingAddress) external onlyTreasury {
        stakingAddress = _stakingAddress;
    }

    function setTransferFeeRate(
        uint256 _buyFeeRate,
        uint256 _treasuryAndMarketingFeeRate,
        uint256 _stakeFeeRate
    ) public onlyTreasury {
        require(_buyFeeRate <= 1, "BUY_FEE_RATE_NO_HIGHER_THAN_1_PERCENT");
        require(
            _stakeFeeRate + _treasuryAndMarketingFeeRate <= 15,
            "SELL_FEE_RATE_NO_HIGHER_THAN_15_PERCENT"
        );
        buyFeeRate = _buyFeeRate;
        treasuryAndMarketingFee = _treasuryAndMarketingFeeRate;
        stakingFee = _stakeFeeRate;
    }

    function setPresaleAddress(address _presaleAddress) public onlyTreasury {
        presaleAddress[_presaleAddress] = true;
    }

    function sweepBNB(address _to) public onlyTreasury {
        payable(_to).transfer(address(this).balance);
    }

    function sweepToken(address _token, address _to) public onlyTreasury {
        IERC20(_token).transfer(_to, IERC20(_token).balanceOf(address(this)));
    }
}

contract MovingOn is TokenERC20 {
    using SafeMath for uint256;

    uint256 public constant DECIMALS = 18;

    IUniswapV2Router02 public uniswapV2Router;

    uint256 public constant maxSupply = 100 * 10**6 * 10**18;

    address public uniswapV2Pair;

    bool inSwap = false;

    modifier swapping() {
        inSwap = true;
        _;
        inSwap = false;
    }

    constructor() TokenERC20("MovingOn Finance", "MOVON", uint8(DECIMALS)) {
        _mint(_msgSender(), maxSupply);

        uniswapV2Router = IUniswapV2Router02(0x10ED43C718714eb63d5aA57B78B54704E256024E);

        uniswapV2Pair = IUniswapV2Factory(uniswapV2Router.factory()).createPair(
                address(this),
                uniswapV2Router.WETH()
            );
    }

    function burn(uint256 amount) public {
        _burn(_msgSender(), amount);
    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal virtual override {
        if (!isAntiWhaleEnded()) {
            if (!presaleAddress[sender]) {
                require(amount <= antiWhaleAmount, "PUMPING_IS_NOT_ALLOWED");
            }
        }

        if (inSwap) {
            super._transfer(sender, recipient, amount);
            return;
        }

        if (sender != uniswapV2Pair && recipient != uniswapV2Pair) {
            if (shouldSwapBack()) {
                swapBack();
            }
        }

        uint256 _amount = shouldTakeFee(sender, recipient)
            ? takeFee(sender, amount)
            : amount;

        super._transfer(sender, recipient, _amount);
    }

    function shouldSwapBack() internal view returns (bool) {
        return !inSwap && msg.sender != uniswapV2Pair;
    }

    function swapBack() internal swapping {
        uint256 contractTokenBalance = super.balanceOf(address(this));

        if (contractTokenBalance > 0) {
            swapTokensForEth(contractTokenBalance, treasuryAddress);
        }
    }

    function swapTokensForEth(uint256 tokenAmount, address receiverEth)
        private
    {
        // generate the uniswap pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();

        _approve(address(this), address(uniswapV2Router), tokenAmount);

        // make the swap
        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of ETH
            path,
            receiverEth, // The contract
            block.timestamp
        );
    }

    function shouldTakeFee(address from, address to)
        internal
        view
        returns (bool)
    {
        return
            (from != address(this) && to != address(this)) &&
            (uniswapV2Pair == from || uniswapV2Pair == to) &&
            !presaleAddress[from];
    }

    function takeFee(address sender, uint256 _amount)
        internal
        swapping
        returns (uint256)
    {
        bool isBuy = uniswapV2Pair == sender;

        if (isBuy) {
            uint256 feeAmount = _amount.mul(buyFeeRate).div(feeDenominator);
            super._transfer(sender, address(this), feeAmount);
            return _amount.sub(feeAmount);
        } else {
            // stake fee
            uint256 stakeAmount = _amount.mul(stakingFee).div(feeDenominator);
            super._transfer(sender, stakingAddress, stakeAmount);

            // treasury fee
            uint256 treasuryAmount = _amount.mul(treasuryAndMarketingFee).div(
                feeDenominator
            );
            super._transfer(sender, address(this), treasuryAmount);

            return _amount.sub(stakeAmount).sub(treasuryAmount);
        }
    }

    // receivable token
    receive() external payable {}
}
